import { useState } from 'react';
import './App.css';

function App() {
  // definizioni degli stati
  const [commessa, setCommessa] = useState([])

  const commessaJSX = user.map(commessa => (<li key={commessa.id}>{commessa.titolo}</li>))
  return (
    <div className="App">
      <header className="App-header">
        commessa

        {commessaJSX}
      </header>
    </div>
  );
}

export default App;
